import React from 'react'
import ReactDOM from 'react-dom';
import './index.css'

class Square extends React.Component {
   render(){
      return(
         <div>
            <article>
               <p>Content</p>
            </article>
            <a className='fb' href='#'>Visiting our stands</a>
         </div>
      )
   }
}


ReactDOM.render(<Square />, document.getElementById('root'));
